import React, { Component } from 'react';

import Header from '../header';
import Filter from '../filter'
import RandomVacancy from '../random-vacancy';
import ItemList from '../item-list';
import Pagination from '../pagination';
import Footer from '../footer';

import './app.css';

export default class App extends Component {

    state = {
        vacancies: [
            {
                title: 'Backend developer',
                special: 'Backend',
                grade: 'Middle',
                skills: [
                    'PHP', 'Jquery', 'HTML',
                    'CSS', 'Wordpress'
                ],
                company: 'Email Soldiers',
                city: 'Ryazan',
                graphic: 'Full Day',
                salary: '35 000',
                date: "08.09.11"
            },
            {
                title: 'frontend developer',
                special: 'frontend',
                grade: 'junior',
                skills: [
                    'JS', 'Jquery', 'HTML',
                    'CSS', 'Wordpress'
                ],
                company: 'Soldiers',
                city: 'Moskow',
                graphic: 'Half Day',
                salary: '25 000',
                date: "08.09.11"
            },
            {
                title: 'testing',
                special: 'Testing',
                grade: 'Senior',
                skills: [
                    'Jest', 'Webpack', 'HTML',
                    'CSS', 'Wordpress'
                ],
                company: 'Email',
                city: 'Almaty',
                graphic: 'Full Day',
                salary: '100 000',
                date: "08.09.11"
            }
        ]
    }

    render() {

        const { vacancies } = this.state;

        return (
            <div className="my-sphere-app">
                <Header />
                <div className="content">
                    <RandomVacancy />
                    <Filter />
                    <ItemList items={vacancies}/>
                    <Pagination />
                    <Footer />
                </div>
            </div>
        )
    }
}
